// ---------- Helpers (same cleaning technique) ----------
const htmlDecode = (s = "") =>
  s
    .replace(/&nbsp;/gi, " ")
    .replace(/&amp;/gi, "&")
    .replace(/&lt;/gi, "<")
    .replace(/&gt;/gi, ">")
    .replace(/&quot;/gi, '"')
    .replace(/&#39;/gi, "'")
    .replace(/&#x2F;/gi, "/");

const htmlToText = (html = "") => {
  if (!html) return "";
  let s = html;
  s = s.replace(/<script[\s\S]*?<\/script>/gi, "")
       .replace(/<style[\s\S]*?<\/style>/gi, "");
  s = s.replace(/<(br|hr)\s*\/?>/gi, "\n")
       .replace(/<\/(p|div|li|h[1-6]|tr|table)>/gi, "\n")
       .replace(/<(p|div|li|h[1-6]|tr|table)[^>]*>/gi, " ");
  s = s.replace(/<\/?[^>]+>/g, "");
  s = htmlDecode(s).replace(/\r/g, "").replace(/[ \t\u00A0]+/g, " ");
  return s;
};

const cutAtFirst = (text, patterns) => {
  let cut = -1;
  for (const re of patterns) {
    const idx = text.search(re);
    if (idx !== -1 && (cut === -1 || idx < cut)) cut = idx;
  }
  return cut === -1 ? text : text.slice(0, cut);
};

const stripSignature = (text) => {
  const sigPatterns = [
    /\n--\s*\n/i,
    /\nSent from my (iPhone|Android).*$/i,
    /\nBest regards[,\s]*\n.*$/i,
    /\nRegards[,\s]*\n.*$/i,
    /\nThanks[,\s]*\n.*$/i
  ];
  const cutIdx = sigPatterns
    .map(re => text.search(re))
    .filter(i => i !== -1)
    .sort((a,b) => a - b)[0];
  return (cutIdx !== undefined) ? text.slice(0, cutIdx) : text;
};

const cleanWhitespace = (s) =>
  s.replace(/\u200B/g, "")
   .replace(/\r/g, "")
   .replace(/[ \t]+/g, " ")
   .replace(/\n{3,}/g, "\n\n")
   .trim();

const firstBodyOnly = (s) => {
  const t = s.replace(/\r\n/g, "\n");
  const cutoffPatterns = [
    /\n\s*On .*? wrote:\s*\n/mi,
    /\n\s*-{2,}\s*Original Message\s*-{2,}\s*\n/mi,
    /\n\s*Begin forwarded message:\s*\n/mi,
    /\n\s*-{2,}\s*Forwarded message\s*-{2,}\s*\n/mi,
    /\n>+/m,
    /\nFrom:\s.*\n(?:.*\n){0,12}?Subject:\s.*\n/mi
  ];
  let newest = cutAtFirst(t, cutoffPatterns);
  newest = cutAtFirst(newest, [
    /<asst@patchbay\.xyz>/i,
    /Forwarded message/i
  ]);
  newest = stripSignature(newest);
  return cleanWhitespace(newest);
};

const pickBody = (email) => {
  const text = (email.text && email.text.trim()) ? email.text : "";
  const html = (!text && email.html) ? email.html : "";
  return text ? text : htmlToText(html);
};

// Helper function to format contact array for display
function formatContacts(contacts) {
  if (!contacts || !Array.isArray(contacts) || contacts.length === 0) {
    return '';
  }

  return contacts.map(contact => {
    if (contact.name && contact.address) {
      return `${contact.name} (${contact.address})`;
    } else if (contact.address) {
      return contact.address;
    }
    return '';
  }).filter(c => c).join(', ');
}

// Helper function to format date
function formatDate(dateString) {
  if (!dateString) return '';

  try {
    const date = new Date(dateString);
    return date.toLocaleString('en-US', {
      weekday: 'short',
      month: 'short',
      day: 'numeric',
      year: 'numeric',
      hour: 'numeric',
      minute: '2-digit',
      hour12: true
    });
  } catch (error) {
    return dateString; // Return original if parsing fails
  }
}

// ---------- Main processing with formatting ----------
const results = [];

for (const item of $('Trigger').all()) {
  const data = item.json;

  // Get all CCs except 'asst@patchbay.xyz'
  const allCC = (data.cc?.value) || [];
  const filteredCC = allCC.filter(cc => cc.address !== "asst@patchbay.xyz");

  // Cleaned latest email body (prefer text, fallback to html)
  let raw = pickBody(data);
  let cleaned = firstBodyOnly(raw);
  // Make single-line (keep if you want compact output)
  const emailText = cleaned.replace(/\n/g, " ").replace(/\s+/g, " ").trim();

  // Create the email object
  const emailObject = {
    ThreadId: data.threadId,
    Label: data.Label,
    EmailId: data.id,
    MessageId: data.messageId,
    References: data.references,
    Subject: data.subject,
    From: data.from?.value || [],
    to: data.to?.value || [],
    cc: filteredCC,
    date: data.date,
    emailText: emailText || '',
  };

  // Format the email as structured text
  let emailsString = '';

  emailsString += '---------------\n';

  // From field
  const fromFormatted = formatContacts(emailObject.From);
  emailsString += `From: ${fromFormatted}\n`;

  // To field
  const toFormatted = formatContacts(emailObject.to);
  emailsString += `To: ${toFormatted}\n`;

  // Cc field (only add if not empty)
  const ccFormatted = formatContacts(emailObject.cc);
  if (ccFormatted) {
    emailsString += `Cc: ${ccFormatted}\n`;
  }

  // Date field
  const dateFormatted = formatDate(emailObject.date);
  emailsString += `Date: ${dateFormatted}\n`;

  // Body field
  emailsString += `Body: ${emailObject.emailText || ''}\n`;

  emailsString += '---------------';

  const output = {
    ThreadId: data.threadId,
    Subject: data.subject,
    Emails: emailsString
  };

  results.push({ json: output });
}

