const text = $input.first().json.emailText;
const model = ($json.model ?? 'gpt-4o-mini').toString();

// Average characters per token (rough) per model family.
// Adjust/extend as needed.
const AVG_CHARS_PER_TOKEN = {
  'gpt-4o-mini': 3.3,
  'gpt-4o': 3.1,
  'gpt-4.1': 3.1,
  'gpt-4.1-mini': 3.2,
  'gpt-3.5-turbo': 4.0,
  'text-embedding-3-large': 3.6,
  'text-embedding-3-small': 3.6,
  'claude-3.5-sonnet': 3.0,
  'claude-3.5-haiku': 3.2,
};

function estimateTokens(str, modelName) {
  const avg = AVG_CHARS_PER_TOKEN[modelName] ?? 3.3;

  // Normalize and split into coarse parts to better mimic subword splits.
  const parts = str
    .normalize('NFKC')
    .split(/(\s+)/)                // keep whitespace groups separate
    .filter(s => s.trim().length > 0);

  let tokens = 0;

  for (const part of parts) {
    // URLs/emails turn into many small pieces
    if (/^https?:\/\//i.test(part) || /@/.test(part)) {
      tokens += Math.ceil(part.length / 3);
      continue;
    }

    // Non-ASCII (CJK, emoji, etc.): assume ~2 tokens per grapheme
    if (/[^\x00-\x7F]/.test(part)) {
      const graphemes = Array.from(part); // split by Unicode code points
      tokens += graphemes.length * 2;
      continue;
    }

    // Split further into letter runs, digit runs, and punctuation
    const chunks = part.match(/[A-Za-z]+|[0-9]+|[^\w\s]/g) || [];
    for (const c of chunks) {
      if (/^[A-Za-z]+$/.test(c)) {
        // Approximate BPE: ~1 token per ~avg chars
        tokens += Math.ceil(c.length / avg);
      } else if (/^[0-9]+$/.test(c)) {
        // Numbers often split more; ~1 per 3 digits is a decent heuristic
        tokens += Math.ceil(c.length / 3);
      } else {
        // Punctuation and symbols: ~1 each
        tokens += 1;
      }
    }
  }

  return tokens;
}

return [
  {
    json: {
      text, text,
      model,
      textLength: text.length,
      estimated_tokens: estimateTokens(text, model),
    },
  },
];

