// --- Otherwise: apply split / clean / chunking ---
const parts = text.split("From:");
const emails = [];

for (let i = 0; i < parts.length; i++) {
  let part = parts[i].trim();
  if (!part) continue;

  const email = (i === 0 ? part : "From: " + part);
  emails.push(email);
}

// --- Cleaner ---
const cleanText = (str) => {
  return str
    .replace(/https?:\/\/[^\s<>()"']+/gi, '')                  // Remove normal URLs
    .replace(/www\.[^\s<>()"']+/gi, '')                        // Remove www links
    .replace(/https?:\s*\/\s*\/[^\s]+/gi, '')                  // Remove broken/spaced links
    .replace(/magiclink=.*?(\s|$)/gi, '')                      // Remove mimecast magiclinks
    .replace(/mimecast\.com\S+/gi, '')                         // Remove MIMECAST encoded URLs
    .replace(/[<>]/g, '')                                      // Remove angle brackets
    .replace(/CGBANNERINDICATOR/gi, '')                        // Remove banners
    .replace(/\n\s*>\s*/g, ' ')                                // Remove "\n > " line continuations
    .replace(/\s{2,}/g, ' ')                                   // Collapse multiple spaces
    .trim();
};

const cleanedEmails = emails.map(cleanText);

// --- Chunk into 5 groups ---
const chunkCount = 5;
const chunkSize = Math.ceil(cleanedEmails.length / chunkCount);

const chunks = [];

for (let i = 0; i < chunkCount; i++) {
  const chunkEmails = cleanedEmails.slice(i * chunkSize, (i + 1) * chunkSize);
  if (chunkEmails.length) {
    chunks.push({
      json: {
        text: chunkEmails.join('\n\n')
      }
    });
  }
}

return chunks;

// Initialize variables
let combinedEmails = '';
let emailContacts = new Map(); // Use Map to store unique name-email pairs

// Get the old Managers list from SessionData
const triggerData = $("Trigger").first().json;
const Managers_old = $("SessionData").first().json.Managers || [];

// Helper function to clean and validate email addresses
function isValidEmail(email) {
  const emailRegex = /^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Z|a-z]{2,}$/;

  // List of emails to exclude
  const excludedEmails = [
    'asst@patchbay.xyz'
  ];

  return emailRegex.test(email) && 
         email.length < 100 && 
         !excludedEmails.includes(email.toLowerCase());
}

// Helper function to check if email exists in Managers list
function isInManagersList(email) {
  const normalizedEmail = email.toLowerCase().trim();
  return Managers_old.some(manager => 
    manager.address && manager.address.toLowerCase().trim() === normalizedEmail
  );
}

// Helper function to clean names
function cleanName(name) {
  return name.replace(/[\|\-\(\)]/g, ' ')
             .replace(/\s+/g, ' ')
             .trim()
             .replace(/^(From|To|Cc):\s*/i, '');
}

// PRIORITY 1: Extract from structured data (Trigger Node)
function extractFromStructuredData(emailData) {
  const fields = ['from', 'to', 'cc', 'bcc'];

  fields.forEach(field => {
    if (emailData[field]) {
      let contacts = [];

      // Handle different data structures from trigger node
      if (emailData[field].value && Array.isArray(emailData[field].value)) {
        contacts = emailData[field].value;
      } else if (Array.isArray(emailData[field])) {
        contacts = emailData[field];
      } else if (typeof emailData[field] === 'object' && emailData[field].address) {
        contacts = [emailData[field]];
      } else if (typeof emailData[field] === 'string') {
        // Parse string format "Name <email@domain.com>" or "email@domain.com"
        const emailRegex = /([^<]*?)\s*<([^>]+)>|([A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Z|a-z]{2,})/g;
        let match;
        while ((match = emailRegex.exec(emailData[field])) !== null) {
          if (match[2] && match[1]) {
            contacts.push({ name: match[1].trim().replace(/"/g, ''), address: match[2] });
          } else if (match[3]) {
            contacts.push({ address: match[3] });
          }
        }
      }

      // Process each contact
      contacts.forEach(contact => {
        if (contact && contact.address) {
          const email = contact.address.toLowerCase().trim();
          let name = contact.name ? cleanName(contact.name) : '';

          // Only add if valid email AND not in Managers list
          if (isValidEmail(email) && !isInManagersList(email)) {
            if (!name || name.length <= 1) {
              // Generate name from email if no name provided
              const emailPrefix = email.split('@')[0];
              name = emailPrefix.replace(/[._]/g, ' ').replace(/\b\w/g, l => l.toUpperCase());
            }
            emailContacts.set(email, name);
          }
        }
      });
    }
  });
}

// Extract from trigger node structured data
if (triggerData) {
  extractFromStructuredData(triggerData);
}

// PRIORITY 2: Process text data from second node (fallback)
function extractFromText(text) {
  // Only extract emails not already found in structured data
  const headerRegex = /^(From|To|Cc):\s*([^(]+?)\s*\(([^)]+)\)/gm;
  let match;
  while ((match = headerRegex.exec(text)) !== null) {
    const name = cleanName(match[2]);
    const email = match[3].toLowerCase().trim();
    // Check if valid, not already added, and not in Managers list
    if (isValidEmail(email) && name && name.length > 1 && !emailContacts.has(email) && !isInManagersList(email)) {
      emailContacts.set(email, name);
    }
  }

  // Handle multiple contacts in same line
  const multiContactRegex = /^(From|To|Cc):\s*(.+)$/gm;
  while ((match = multiContactRegex.exec(text)) !== null) {
    const contactsLine = match[2];
    const contactRegex = /([^,(]+?)\s*\(([^)]+)\)/g;
    let contactMatch;
    while ((contactMatch = contactRegex.exec(contactsLine)) !== null) {
      const name = cleanName(contactMatch[1]);
      const email = contactMatch[2].toLowerCase().trim();
      // Check if valid, not already added, and not in Managers list
      if (isValidEmail(email) && name && name.length > 1 && !emailContacts.has(email) && !isInManagersList(email)) {
        emailContacts.set(email, name);
      }
    }
  }

  // Handle email-only format
  const emailOnlyRegex = /^(From|To|Cc):\s*([A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Z|a-z]{2,}(?:\s*,\s*[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Z|a-z]{2,})*)\s*$/gm;
  while ((match = emailOnlyRegex.exec(text)) !== null) {
    const emailsLine = match[2];
    const emails = emailsLine.split(/\s*,\s*/);
    emails.forEach(email => {
      email = email.toLowerCase().trim();
      // Check if valid, not already added, and not in Managers list
      if (isValidEmail(email) && !emailContacts.has(email) && !isInManagersList(email)) {
        const emailPrefix = email.split('@')[0];
        const generatedName = emailPrefix.replace(/[._]/g, ' ').replace(/\b\w/g, l => l.toUpperCase());
        emailContacts.set(email, generatedName);
      }
    });
  }
}

// Process all items from input node for text combining and fallback extraction
for (const item of $input.all()) {
  if (item.json) {
    // Combine email text content
    if (item.json.text) {
      combinedEmails += item.json.text + '\n\n';

      // Extract from text only if not already found in structured data
      extractFromText(item.json.text);
    } else if (item.json.html) {
      combinedEmails += item.json.html + '\n\n';
