function parseEmailThread(threadText) {
  if (!threadText || threadText.trim() === '') {
    return [];
  }

  const emails = [];

  // Split by email separators (looking for patterns like "_______________" or "---------------")
  const emailBlocks = threadText.split(/_{10,}|_{3,}\n/);

  for (const block of emailBlocks) {
    if (!block.trim()) continue;

    const email = {};
    const lines = block.trim().split('\n');

    // Parse email fields
    let bodyStartIndex = -1;

    for (let i = 0; i < lines.length; i++) {
      const line = lines[i].trim();

      if (line.startsWith('From:')) {
        email.from = line.replace('From:', '').trim();
      } else if (line.startsWith('To:')) {
        email.to = line.replace('To:', '').trim();
      } else if (line.startsWith('CC:') || line.startsWith('Cc:')) {
        email.cc = line.replace(/CC:|Cc:/i, '').trim();
      } else if (line.startsWith('Date:')) {
        const dateStr = line.replace('Date:', '').trim();
        email.dateString = dateStr;
        email.date = parseEmailDate(dateStr);
      } else if (line.startsWith('Subject:')) {
        email.subject = line.replace('Subject:', '').trim();
      } else if (line.startsWith('Body:')) {
        bodyStartIndex = i + 1;
        break;
      }
    }

    // Extract body content
    if (bodyStartIndex > -1) {
      const bodyLines = lines.slice(bodyStartIndex);
      email.body = bodyLines.join('\n').trim();
    }

    // Only add email if it has required fields
    if (email.from && email.date) {
      emails.push(email);
    }
  }

  return emails;
}

function parseEmailDate(dateStr) {
  // Handle various date formats

  // Format: "Wednesday, October 1, 2025 at 12:56 PM PDT"
  const atMatch = dateStr.match(/(\w+,\s+)?(\w+\s+\d+,\s+\d{4})\s+at\s+(\d+:\d+\s+[AP]M)/i);
  if (atMatch) {
    return new Date(`${atMatch[2]} ${atMatch[3]}`);
  }

  // Format: "Sep 24, 2025" or "Sep 16, 2025"
  const shortDateMatch = dateStr.match(/\w+\s+\d+,\s+\d{4}/);
  if (shortDateMatch) {
    return new Date(shortDateMatch[0]);
  }

  // Format: "Monday, September 15, 2025 at 8:03 PM"
  const longDateMatch = dateStr.match(/\w+,\s+\w+\s+\d+,\s+\d{4}/);
  if (longDateMatch) {
    return new Date(longDateMatch[0]);
  }

  // Try parsing as-is
  const parsed = new Date(dateStr);
  return isNaN(parsed.getTime()) ? new Date(0) : parsed;
}

